class Solution:
    def canJump(nums: list[int]) -> bool:
        dp = dict()
        dp[len(nums) - 1] = 0
        size = len(nums) - 1
        goalIndex = len(nums) - 1
        for index in range(goalIndex - 1, -1, -1):
            if index + nums[index] >= goalIndex:
                bestcandidate = float("inf")
                for i in range(nums[index]):
                    target = i + index + 1
                    if dp.get(target, None) or target  == size:
                        bestcandidate = min(dp[target], bestcandidate)
                dp[index] = bestcandidate + 1
                goalIndex = index
        return dp[0]


